DROP TABLE IF EXISTS city;
DROP TABLE IF EXISTS century;
DROP TABLE IF EXISTS goods_of_city;
DROP TABLE IF EXISTS goods;

CREATE TABLE city (
  seq integer PRIMARY KEY,
  name text NOT NULL,
  area text,
  sea text,
  permit text,
  x integer,
  y integer
);

CREATE TABLE century (
  seq integer PRIMARY KEY,
  name text NOT NULL
);

CREATE TABLE goods_of_city (
  seq integer PRIMARY KEY,
  city_name text NOT NULL,
  goods_type text NOT NULL,
  goods_name text NOT NULL,
  development integer,
  investing integer,
  center text,
  century text
);

CREATE TABLE goods (
  seq integer PRIMARY KEY,
  name text NOT NULL,
  type text NOT NULL,
  special text
);




